    <ConversationList style={{ backgroundColor: "#bacee0" }}>
      <Conversation name="Baron" lastSenderName="Baron" info="Yes i can do it for you">
        <Avatar name="Baron" status="dnd" />
      </Conversation>
    </ConversationList>
  );
};
